import React, { Component, Fragment } from 'react'
import '../styles/style.css';
import {Route, NavLink, Link, Redirect} from 'react-router-dom'
import SelectItem from '../util/SelectItem'
import EquityScreen from './screeners/EquityScreen';
import Mostactive from './screeners/Mostactive';
import Gainers from './screeners/Gainers';
import Losers from './screeners/Losers';
import apiCall from '../util/apiCall';
import { faFileExcel } from '@fortawesome/free-solid-svg-icons';

const linkStyleActive = {
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    textDecoration: 'none',
    width: '70px',
    color: 'rgb(58, 85, 143)',
    height: '8vh',
    padding: '5px',
    backgroundColor: 'rgb(160, 236, 250)',
    borderBottom: '3px solid rgb(58, 85, 143)'
}

export default class Screener extends Component {
    state = {
        listTen: null
    }

    render() {
        let screenerRoutes
        screenerRoutes = [
            <Route exact path="/dashboard/screener/mostactive/:symbol?" render={(props)=><Redirect to={linkToMostactive}/>}/>,
            <Route exact path="/dashboard/screener/gainers/:symbol?" render={(props)=><Redirect to={linkToGainers}/>}/>,
            <Route exact path="/dashboard/screener/losers/:symbol?" render={(props)=><Redirect to={linkToLosers}/>}/>,
            
            <Route exact path="/dashboard/screener/mostactive/:symbol?" render={(props)=>
                <Mostactive tickerQuote={this.state.tickerQuote} {...props} />}/>,
            <Route exact path="/dashboard/screener/gainers/:symbol?" render={(props)=>
                <Gainers {...props} />}/>,
            <Route exact path="/dashboard/screener/losers/:symbol?" render={(props)=>
                <Losers {...props} />}/>,
        ]
           
        let linkToMostactive = `/dashboard/screener/mostactive`
        let linkToGainers = `/dashboard/screener/gainers`
        let linkToLosers = `/dashboard/screener/losers`
        let linkToCustomScreen = `/dashboard/screener/custom`
    
    
        return (
            <div>
      <div style={{display:"flex", flexDirection:"column",}}>
                hello there
                hello there
                hello there
            </div>
            <div>
                <Link to="/mostactive">mostactive</Link>
                <Link to="/gainers">gainers</Link>
                <Link to="/losers">losers</Link>
            </div>
            <idv>
                {screenerRoutes}
            </idv>
            </div>
        )
    }
}
